import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";
import Slider from "react-slick";
import A1 from "./proimg1.js";
import Ttt from "./Ttt.js";

function CommonBurger() {
  let fullphotos = A1.map((A1) => <Ttt img={A1.img} />);

  return (
    <div style={{ height: "150px", width: "100%" }}>
      <Slider
        slidesToShow={1}
        slidesToScroll={1}
        arrows={false}
        fade={true}
        autoplay={true}
        autoplaySpeed={3000}
      >
        {fullphotos}
      </Slider>
    </div>
  );
}

export default CommonBurger;
